function run(response, quantity) {
    let extenso = ['um', 'dois', 'tr[êe]s', 'quatro', 'cinco'];

    var menu = "";
    var regexOptions = [];

    try
    {
        response = JSON.parse(response);

        for (var i = 0; i < quantity; i++)
        {
        	var detail = response.details[i];
        	var name = detail.name;

            var menuOption = i + 1;
            var option = `${menuOption}|${extenso[i]}`;

            if (quantity > 1)
            {
                menu += `*${menuOption} - ${name}*\n📍${detail.formattedAddress}\n\n`;
            }
            else
            {
                menu += `*${name}*\n📍${detail.formattedAddress}\n\n`;
            }

            var regex = 
            {
                "regex": "^(?i)(((op|op[cç])([cç][aâãáà]o)?)?\\s*("+option+")|("+option+")?\\s*(\\-)?\\s*(\\b"+name+"\\b))$",
                "name": name,
                "address": detail.formattedAddress,
                "option": `${menuOption}`
            };
            regexOptions.push(regex);
        }

        menu = menu.slice(0, -2); //remove the '\n\n' of the end
        return { "menu": menu, "regexOptions": regexOptions };
    }
    catch (ex)
    {
        return ex;
    }
}

